import React from 'react';

function Footer() {
    return (
        <footer>
            <p>&copy; 2024 Munipal. All rights reserved.</p>
            <div>
                <a href="https://facebook.com">Facebook</a>
                <a href="https://twitter.com">Twitter</a>
                <a href="https://linkedin.com">LinkedIn</a>
            </div>
        </footer>
    );
}

export default Footer;
